package com.kuaixiu.materiel.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-03-27 下午04:14:22 * @version: V 1.0 */public class MaterielStock extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private Integer id ;    /**     * 物料种类id     */    private Integer materielId ;    /**     * 数量     */    private Integer number ;    /**     * 价格     */    private java.math.BigDecimal price ;    /**     *      */    private java.util.Date createTime ;    /**     * get:     */    public Integer getId(){        return this.id;    }    /**     * set：     */    public void setId(Integer id){        this.id=id;    }    /**     * get:物料种类id     */    public Integer getMaterielId(){        return this.materielId;    }    /**     * set：物料种类id     */    public void setMaterielId(Integer materielId){        this.materielId=materielId;    }    /**     * get:数量     */    public Integer getNumber(){        return this.number;    }    /**     * set：数量     */    public void setNumber(Integer number){        this.number=number;    }    /**     * get:价格     */    public java.math.BigDecimal getPrice(){        return this.price;    }    /**     * set：价格     */    public void setPrice(java.math.BigDecimal price){        this.price=price;    }    /**     * get:     */    public java.util.Date getCreateTime(){        return this.createTime;    }    /**     * set：     */    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }}